import React from "react";
import './Home.css';
import bgimg from "../images/Scanner.png";

const Home = () => {
  return (
    <div className="home">
        <img
                    src={bgimg}
                    alt="Logo"
                    class="img-fluid"
                />
        <h2>Your one stop</h2>
    </div>
  );
};

export default Home;
